-<!--検索キーワード--><font color="#FFFFFF">(2017 KASK)(KASK URBAN&CASUAL)(0907新品)</font><br><!--サイズ表記テーブル-->  <table width="410" style="font-size:13px;"  border="0" cellspacing="0" cellpadding="0">    <tr>    <td width="10" height="20" bgcolor="#ffffff"></td>    <td   colspan="6" bgcolor="#ffffff">■カラーサイズバリエーション </td>    </tr>  <tr>    <td width="10"  bgcolor="#ffffff"></td><td width="200"  bgcolor="#ffffff" >ホワイト</td>   <td width="50"  bgcolor="#ffffff" >M</td><td width="50"  bgcolor="#ffffff" >L</td></tr><tr>    <td width="10"  bgcolor="#afeeee"></td><td width="200"  bgcolor="#afeeee" >ブラック</td>   <td width="50"  bgcolor="#afeeee" >M</td><td width="50"  bgcolor="#afeeee" >L</td></tr><tr>    <td width="10"  bgcolor="#ffffff"></td><td width="200"  bgcolor="#ffffff" >ANT</td>   <td width="50"  bgcolor="#ffffff" >M</td><td width="50"  bgcolor="#ffffff" >L</td></tr><tr>    <td width="10"  bgcolor="#afeeee"></td><td width="200"  bgcolor="#afeeee" >レッド</td>   <td width="50"  bgcolor="#afeeee" >M</td><td width="50"  bgcolor="#afeeee" >L</td></tr><tr>    <td width="10"  bgcolor="#ffffff"></td><td width="200"  bgcolor="#ffffff" >ライム</td>   <td width="50"  bgcolor="#ffffff" >M</td><td width="50"  bgcolor="#ffffff" >L</td></tr><tr>    <td width="10"  bgcolor="#afeeee"></td><td width="200"  bgcolor="#afeeee" >ライトブルー</td>   <td width="50"  bgcolor="#afeeee" >M</td><td width="50"  bgcolor="#afeeee" >L</td></tr><tr>    <td width="10"  bgcolor="#ffffff"></td><td width="200"  bgcolor="#ffffff" >フューシャ</td>   <td width="50"  bgcolor="#ffffff" >M</td><td width="50"  bgcolor="#ffffff" >L</td></tr></table><!--サイズ表記テーブルここまで-->  <br><br><br><table border="0" cellpadding="0" cellspacing="0" width="640"><tr>  <td colspan="3">・状態：新品<br />      ・サイズ：M　55-58cm、L　59-62cm<br>  ・重量： M 220g、L 240g&nbsp;<br>・安全認証基準/CE EN 1078<br />・JCF公認 <br /> <br /> <br /><font size="4"><b>RAPIDO </b></font><br> ラインナップでトップクラスの軽量性を誇り、24個のエアベントを施したrapidoはKASKのエントリーモデル。内部のポリスチレン層を外部のポリカーボネートと連結し、より優れた衝撃吸収性を実現する“ IN-MOULDING TECHNOLOGY”を採用し、転倒時に内部シェルを維持して衝撃を吸収することでヘルメット本体の粉砕を防ぎます。<br> <br> <br><br /><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/rapido.jpg" ><br><br></td></tr></table><!--商品説明-->  <br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/160907_3.jpg" ><br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/kask.jpg" ><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/top/about-attention640.jpg" border="0"><br><table width="640" bgcolor="#dad7d2"><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>完成車の場合は組上げ作業の関係により、発送は商品入荷日から最長で約1週間～10日後となります。<br>予めご了承ください。</b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>当店に掲載されている商品は、当店在庫、及びメーカー在庫をもとに運営しております。<br>商品ページの在庫状況はリアルタイムの更新ではない為、ご注文が可能な状態であっても売り切れになってしまう可能性がございます。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>メーカーおよび代理店にて完売または納期未定となってしまった場合は、その旨をご連絡の上、誠に申し訳ございませんが、ご注文を変更またはキャンセルのご対応とさせていただいております。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>ご注文後/発送後キャンセル・交換・返品等は基本的には出来かねます。<br>お客様ご都合での返品・交換を強くご希望される場合に関しましては、ご購入金額の約30％相当の金額での、買取(買い戻し)のみのご対応とさせていただいております。<br>サイズや互換性など少しでもご不明な点がございましたら、些細な事でもお気軽にお問い合わせ下さい。</b></font></td></tr>
</table><style type="text/css">
