eee" >M</td><td width="50"  bgcolor="#afeeee" >-</td></tr></table><!--サイズ表記テーブルここまで-->  <br><br><br><table border="0" cellpadding="0" cellspacing="0" width="640"><tr>  <td colspan="3">・状態：新品<br />      ・サイズ：M 55-58 cm、L 59-62 cm<br>  ・重量：M 230g&nbsp; L 295g<br>・安全認証基準/CE EN 1078 <br> ・JCF公認<br /><br /><font size="4"><b>PROTONE </b></font><br>protoneは2014年のツール・ド・フランスに合わせて発表された、TeamSkyとの共同開発による最新のヘルメットです。風洞テストをはじめとした各種の厳格なテストと熱力学の分析を経て、エアロダイナミクスと熱発散を向上させたprotoneは、Team Skyの選手たちやスポーツ科学の専門家との緊密なコラボレーションにより開発されました。通気口の空いたヘルメットの中で最も抵抗係数が低いものの一つであり、優れた熱放散率を持っています。<br><br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/protone_spec.jpg"><br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/160902_p_1.jpg"><br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/160902_p_2.jpg"><br><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/smartbanner/kask.jpg"></td></tr></table><!--商品説明--><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/top/about-attention640.jpg" border="0"><br><table width="640" bgcolor="#dad7d2"><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>完成車の場合は組上げ作業の関係により、発送は商品入荷日から最長で約1週間～10日後となります。<br>予めご了承ください。</b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>当店に掲載されている商品は、当店在庫、及びメーカー在庫をもとに運営しております。<br>商品ページの在庫状況はリアルタイムの更新ではない為、ご注文が可能な状態であっても売り切れになってしまう可能性がございます。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>メーカーおよび代理店にて完売または納期未定となってしまった場合は、その旨をご連絡の上、誠に申し訳ございませんが、ご注文を変更またはキャンセルのご対応とさせていただいております。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>ご注文後/発送後キャンセル・交換・返品等は基本的には出来か